INSERT INTO `encuesta` VALUES ('1', 'ENCUESTA A DOCENTES', 'El objetivo de esta encuesta es describir las tendencias que se presentan en la Universidad de Cartagena en cuanto a la enseñanza y evaluación de la lectura y escritura académicas. Ello con el fin de interpretar los resultados de la investigación titulada “Evaluación de la comprensión textual en la Universidad de Cartagena”. Su respuesta será de gran valor para la investigación, por lo que requerimos de su honestidad, compromiso y responsabilidad al diligenciarla.<br/> <strong>IMPORTANTE: <u>su respuesta NO incide de ninguna forma en la evaluación de su desempeño como docente o estudiante, ni será utilizada para fines distinto a la investigación.</u></strong>  </p><p style=\"text-align:right\">Responsable: Cátedra Unesco para la Lectura y la Escritura-sede Universidad de Cartagena.');
INSERT INTO `encuesta` VALUES ('2', 'ENCUESTA PARA ESTUDIANTES', 'El objetivo de esta encuesta es describir las tendencias que se presentan en la Universidad de Cartagena en cuanto a la enseñanza y evaluación de la lectura y escritura académicas. Ello con el fin de interpretar los resultados de la investigación titulada “Evaluación de la comprensión textual en la Universidad de Cartagena”. Su respuesta será de gran valor para la investigación, por lo que requerimos de su honestidad, compromiso y responsabilidad al diligenciarla.<br/> <strong>IMPORTANTE: <u>su respuesta NO incide de ninguna forma en la evaluación de su desempeño como docente o estudiante, ni será utilizada para fines distinto a la investigación.</u></strong>  </p><p style=\"text-align:right\">Responsable: Cátedra Unesco para la Lectura y la Escritura-sede Universidad de Cartagena.');
